//SPDX-License-Identifier: MIT
pragma solidity >=0.4.16 <0.9.0;

contract wallet{
    address  public owner;
    transaction[] public history;
    mapping(address=>uint) balance_at;

    struct transaction{
        //address addr;
        string transaction_type;    //sent/received
        uint amount; 
    }

    constructor() public payable{
        owner = msg.sender;
        balance_at[owner] = msg.value;
    }

    modifier onlyOwner(){
        require(msg.sender == owner, "error: only the owner is allowed to call this function");
        _;
    }

    // function getHistory() public view onlyOwner returns (address){
    //     return history[history.length-1].addr;
    // }
    function sendMoney(address receiver, uint amt) public payable onlyOwner{
        require(amt <= balance_at[owner], "error: insufficient funds in account");

        balance_at[owner] -= amt;
        balance_at[receiver] += amt;
        
        //adding to logs
        transaction memory tr = transaction("sent", amt);
        history.push(tr);
    } 

    function receiveMoney(uint amt) public payable{
        //only non-owner can send money to the owner
        require(msg.sender != owner, "owner can't send money to themself");
        
        balance_at[owner] += amt;
        balance_at[msg.sender] -= amt;
        

        //adding to logs
        transaction memory tr = transaction("received", amt);
        history.push(tr);
    }

    function checkBalance() public view returns(uint){
        return balance_at[msg.sender];
    }

    // function viewHistory() public view onlyOwner returns(transaction[] memory){
    //     return history;
    // }
}
